import React from 'react'

const UserCart = ({userName,img}) => {
  const me= localStorage.getItem("userName");
  return (
    <div className='relative flex items-center w-[100%] h-[50px] mb-2 pl-2 md:mb-5'>
        <div className={`w-[35px] md:w-[45px] rounded-full overflow-hidden ${userName !== me? "absolute top-0 ri animate-ping":""}`}><img className='w-[100%] h-[100%] object-cover' src={img} alt=''/></div>
        <p className={`pl-2 overflow-hidden `}>{userName}</p>
    </div>
  )
}

export default UserCart;
